import './Prodigal.css'
import { useForm } from 'react-hook-form'
import { useEffect, useState } from 'react'
import { get, sendForm, ProgressBar } from '../Tools/Utils/Utils'

const SkaniForm = () => {

const Blast = () => {

const {register, handleSubmit} = useForm()
const [progress, setProgress] = useState(0)

	return (
		<div className='ToolForm'>
			<ProgressBar progress={ progress }/>
			<form onSubmit={ handleSubmit(data => sendForm(data, data.type, setProgress)) }>
				<input {...register("title") } type="text" placeholder="Title" />
				<select {...register("format") }>
					<option value="gbk">Genbank</option>
					<option value="gff">Gene feature format</option>
					<option value="sco">.sco</option>
				</select>
				<input {...register("query") } type="text" placeholder="Query" />
				<input {...register("files") } type="file" multiple/>
				<input {...register("args")} placeholder="Arguments" type="text" />
				<input type="submit"/>
			</form>
		</div>
	)
}

const BlastDb = () => {

	const {register, handleSubmit} = useForm()
	const [progress, setProgress] = useState(0)

	return (
		<div className='ToolForm'>
			<ProgressBar progress={ progress } />
			<form onSubmit={handleSubmit(data => sendForm(data, '/services/skani-sketch', setProgress))}>
				<input {...register("title")} type="text" placeholder="Title"/>
				<input {...register("query")} type="text" placeholder="Query"/>
				<input {...register("files")} type="file" multiple/>
				<input type="submit" />
			</form>
		</div>
	)
}

	return(
		<div className={'Form'}>
			<Blast/>
			<BlastDb/>
		</div>
	)

}
export default SkaniForm
